import React from 'react';

const Home = () => {
  return (
    <div>
      <iframe
        width="100%"
        height="600"
        style={{ border: 0 }}
        loading="lazy"
        allowFullScreen
        referrerPolicy="no-referrer-when-downgrade"
        src="https://www.google.com/maps/embed/v1/place?key=YOUR_API_KEY&q=hospitals"
        title="Google Maps"
      ></iframe>
    </div>
  );
};

export default Home;
